import ContainerLeft from "./container/container-left";
import ContainerCenter from "./container/container-center";
import ContainerRight from "./container/container-right";
import CurrentHead from '@/components/current-head';
export default {
  name: "index",
  components: {
    ContainerLeft: ContainerLeft,
    ContainerCenter: ContainerCenter,
    ContainerRight: ContainerRight,
    CurrentHead: CurrentHead
  },
  data: function data() {
    return {
      currentTime: ''
    };
  },
  created: function created() {
    window.localStorage.clear();
    this.getNowTime();
  },
  methods: {
    timestampToTime: function timestampToTime(data) {
      var yyyy = data.getFullYear();
      var MM = (data.getMonth() + 1).toString().padStart(2, '0');
      var dd = data.getDate().toString().padStart(2, '0');
      var h = data.getHours().toString().padStart(2, '0');
      var m = data.getMinutes().toString().padStart(2, '0');
      var s = data.getSeconds().toString().padStart(2, '0');
      return yyyy + '年' + MM + '月' + dd + '日 ' + h + ':' + m + ':' + s;
    },
    getNowTime: function getNowTime() {
      var aData = new Date();
      this.currentTime = this.timestampToTime(aData);
    }
  }
};
